import React, { Component } from "react";
import Login from "./components/login";
import './App.css';

class App extends Component {
  render() {
    return (
      <React.Fragment>


        <header className="App-header">
          Login
      </header>
        <main className="buttons">
          <Login />>
      </main>
      </React.Fragment>
    );
  }
}

export default App;
